var title_f16_35_16945="Antidepressants in HIV";
var content_f16_35_16945=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F70410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F70410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antidepressant medications in HIV disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"10%\">",
"     </colgroup>",
"     <colgroup span=\"3\" width=\"23%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Antidepressant",
"       </td>",
"       <td class=\"subtitle1\">",
"        Initial dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Typical dose range",
"        <br/>",
"        (see NOTE below)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Tolerability profile relevant to management of patients with HIV",
"       </td>",
"       <td class=\"subtitle1\">",
"        Mechanism of interaction with HIV antiretroviral drugs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Selected pharmacokinetic interactions with HIV antiretroviral drugs and management suggestions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Selective serotonin reuptake inhibitors (SSRIs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Citalopram",
"       </td>",
"       <td>",
"        20 mg daily",
"       </td>",
"       <td>",
"        20 to 40 mg daily*",
"       </td>",
"       <td rowspan=\"2\">",
"        Applies to citalopram and escitalopram: Generally well tolerated; effective for anxiety; low risk of sleep disturbance.",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Citalopram and escitalopram are metbolized by CYP2C19 and 3A4",
"        </p>",
"        Neither citalopram nor escitalopram significantly alter CYP metabolism",
"       </td>",
"       <td>",
"        <p>",
"         Applies to citalopram:",
"        </p>",
"        <p>",
"         Possible elevated risk of cardiac arrhythmia in combination with agents that increase citalopram concentrations and/or prolong QTc interval.",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"        Citalopram dose should not exceed 20 mg per day in patients receiving moderate or strong CYP2C19 inhibitors which may INCREASE citalopram concentrations, including* efavirenz (variable effects) and etravirine.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Escitalopram",
"       </td>",
"       <td>",
"        10 mg daily",
"       </td>",
"       <td>",
"        10 to 20 mg daily",
"       </td>",
"       <td>",
"        Applies to escitalopram: Low risk of significant drug interactions with HIV antiretrovirals.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sertraline",
"       </td>",
"       <td>",
"        25 to 50 mg daily",
"       </td>",
"       <td>",
"        100 to 200 mg daily",
"       </td>",
"       <td>",
"        <p>",
"         Non-sedating; low risk of insomnia; lacks significant cardiac effects.",
"        </p>",
"        More frequent diarrhea.",
"       </td>",
"       <td>",
"        <p>",
"         Sertraline is metabolized CYP2D6",
"        </p>",
"        Sertraline is an inhibitor of CYP2D6 at doses &ge;200 mg daily",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2D6 including cobicistat containing coformulations, lopinavir-ritonavir, and tipranavir may INCREASE sertraline concentrations.",
"        </p>",
"        <p>",
"         Low dose (ie 100 to 200 mg) ritonavir for pharmacokinetic \"boosting\" of protease inhibitors is less likely to cause a significant interaction.",
"        </p>",
"        <p>",
"         Efavirenz and darunavir-ritonavir DECREASED sertraline AUCs by 39 and 49 percent respectively in small studies of healthy volunteers. Nevirapine may have a similar effect.",
"        </p>",
"        Titrate sertraline dose based on response.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fluoxetine",
"       </td>",
"       <td>",
"        10 mg daily",
"       </td>",
"       <td>",
"        20 to 40 mg daily",
"       </td>",
"       <td>",
"        <p>",
"         Activating effect may be useful for treatment of depressed patients with low energy or hypersomnia.",
"        </p>",
"        Tapering upon discontinuation is not needed due to long half-life.",
"       </td>",
"       <td>",
"        <p>",
"         Fluoxetine is metabolized by CYP2C19 and 2D6",
"        </p>",
"        Fluoxetine is an inhibitor of CYP1A2, 2C9, 2C19 and 2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2D6, including cobicistat containing coformulations, darunavir, lopinavir-ritonavir, ritonavir, and tipranavir may INCREASE fluoxetine concentrations.",
"        </p>",
"        <p>",
"         Possible elevated risk of cardiac arrhythmia in combination with other agents that prolong QTc interval and/or increase fluoxetine concentrations.",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"        <p>",
"         Low dose (ie 100 to 200 mg) ritonavir for pharmacokinetic \"boosting\" of protease inhibitors is less likely to cause a significant interaction.",
"        </p>",
"        <p>",
"         Strong inducers of CYP2C19 and/or 2D6, including nevirapine, can DECREASE fluoxetine concentrations.",
"        </p>",
"        Long half-life of fluoxetine may complicate evaluation of response, effect of interactions, and wash-out.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Paroxetine",
"       </td>",
"       <td>",
"        10 mg each bedtime",
"       </td>",
"       <td>",
"        20 to 50 mg each bedtime",
"       </td>",
"       <td>",
"        <p>",
"         Sedating; possibly useful for depressed or anxious patients with insomnia.",
"        </p>",
"        Mild anticholinergic effects.",
"       </td>",
"       <td>",
"        <p>",
"         Paroxetine is metabolized by CYP2D6",
"        </p>",
"        Paroxetine is an inhibitor of CYP2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2D6 including cobicistat containing coformulations, lopinavir-ritonavir and tipranavir may INCREASE paroxetine concentrations.",
"        </p>",
"        <p>",
"         Low dose (ie 100 to 200 mg) ritonavir for pharmacokinetic \"boosting\" of protease inhibitors is less likely to cause a significant interaction.",
"        </p>",
"        <p>",
"         Darunavir-ritonavir and fosamprenavir-ritonavir DECREASED paroxetine AUC by 39 percent and 55 percent respectively in small studies of healthy volunteers.",
"        </p>",
"        Titrate paroxetine dose based upon response.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fluvoxamine",
"       </td>",
"       <td>",
"        50 mg each bedtime",
"       </td>",
"       <td>",
"        150 to 250 mg each bedtime",
"       </td>",
"       <td>",
"        Somewhat sedating.",
"       </td>",
"       <td>",
"        <p>",
"         Fluvoxamine is metabolized by CYPs1A2 and 2D6",
"        </p>",
"        Fluvoxamine is an inhibitor of CYPs1A2 and 2C19",
"       </td>",
"       <td>",
"        Significant drug interactions. Strong inhibitors of CYP1A2 and/or 2D6 including cobicistat containing coformulations, darunavir, lopinavir, lopinavir/ritonavir, and tipranavir may INCREASE fluvoxamine concentrations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Serotonin-norepinephrine reuptake inhibitors (SNRIs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Duloxetine",
"       </td>",
"       <td>",
"        30 mg",
"       </td>",
"       <td>",
"        60 to 120 mg each bedtime or in divided doses",
"       </td>",
"       <td>",
"        Mildly sedating; useful for patients with comorbid painful conditions such as neuropathy or chronic pain.",
"       </td>",
"       <td>",
"        Duloxetine is metabolized by CYPs1A2 and 2D6",
"       </td>",
"       <td>",
"        Significant drug interactions. Strong inhibitors of CYPs 1A2 and/or 2D6 including cobicistat containing coformulations, darunavir, lopinavir, lopinavir/ritonavir, and tipranavir may INCREASE duloxetine concentrations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Desvenlafaxine",
"       </td>",
"       <td>",
"        50 mg",
"       </td>",
"       <td>",
"        50 to 100 mg once daily",
"       </td>",
"       <td rowspan=\"3\">",
"        Applies to venlafaxine and desvenlafaxine: Activating effect may be useful for treatment of melancholic depressed patients with low energy or hypersomnia. Useful for patients with comorbid painful conditions such as diabetic neuropathy.",
"       </td>",
"       <td>",
"        <p>",
"         Desvenlafaxine undergoes UDP-UGT conjugation and is metabolized by CYP3A4 (minor)",
"        </p>",
"        Duloxetine does not alter CYP metabolism",
"       </td>",
"       <td>",
"        Desvenlafaxine has a low risk of significant interactions with HIV antiretroviral medications.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Venlafaxine (extended release)",
"       </td>",
"       <td>",
"        37.5 mg",
"       </td>",
"       <td>",
"        75 to 225 mg once daily",
"       </td>",
"       <td rowspan=\"2\">",
"        Venlafaxine is metabolized by CYPs 2D6 and 3A4",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Strong inhibitors of CYP2D6 and/or 3A4 including atazanavir, cobicistat containing coformulations, darunavir, fosamprenavir, indinavir, lopinavir, lopinavir-ritonavir, nelfinavir, saquinavir, and tipranavir may INCREASE venlafaxine concentrations.",
"        </p>",
"        <p>",
"         Venlafaxine co-administered with saquinavir (with or without ritonavir) may prolong QTc interval.",
"        </p>",
"        <p>",
"         AUC of indinavir (without ritonavir) was decreased by 28 percent by venlafaxine in a small study of healthy volunteers.",
"        </p>",
"        Strong inducers of CYP2D6 and/or 3A4 including efavirenz (variable effects), etravirine, and nevirapine may DECREASE venlafaxine concentrations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Venlafaxine (immediate release)",
"       </td>",
"       <td>",
"        37.5 mg once or twice per day",
"       </td>",
"       <td>",
"        75 to 375 mg per day in two or three divided doses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Noradrenergic and specific serotonergic antidepressant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mirtazapine",
"       </td>",
"       <td>",
"        7.5 to 15 mg each bedtime",
"       </td>",
"       <td>",
"        15 to 45 mg each bedtime",
"       </td>",
"       <td>",
"        Sedating; useful for patients with insomnia or who may benefit from weight gain which can be substantial. Appetite stimulant and anti-nausea effects can be noted within days.",
"       </td>",
"       <td>",
"        Mirtazapine is metabolized by CYPs 1A2, 2D6 and 3A4",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP1A2, 2D6 and/or 3A4 including atazanavir, cobicistat containing coformulations, darunavir, fosamprenavir, indinavir, lopinavir, lopinavir-ritonavir, nelfinavir, saquinavir, and tipranavir may INCREASE mirtazapine concentrations.",
"        </p>",
"        Strong inducers of CYP 3A4 including efavirenz (variable effects), etravirine (variable effects) and nevirapine may DECREASE mirtazapine concentrations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Serotonin modulators",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Trazodone",
"       </td>",
"       <td rowspan=\"2\">",
"        50 to 100 mg each bedtime",
"       </td>",
"       <td>",
"        50 to 150 mg each bedtime for sleep",
"       </td>",
"       <td rowspan=\"2\">",
"        Used in low doses as an adjunct to SSRI for treatment of insomnia.",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Trazodone is metabolized by CYP1A2, 2D6 and 3A4",
"        </p>",
"        Trazodone is a Pgp inducer",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Strong inhibitors of CYP1A2, 2D6 and/or 3A4, including all HIV protease inhibitors",
"         <sup>",
"          &Delta;",
"         </sup>",
"         and cobicistat containing coformulations have been shown to INCREASE concentrations of trazodone. Use lowest starting dose of trazodone. Closely monitor effects.",
"        </p>",
"        <p>",
"         <strong>",
"          NOTE:",
"         </strong>",
"         Use of saquinavir or saquinavir-ritonavir with trazodone is contraindicated. Do NOT coadminister.",
"        </p>",
"        <p>",
"         Strong inducers of CYP3A4 including efavirenz (variable effects), etravirine (variable effects) and nevirapine may DECREASE trazodone levels.",
"        </p>",
"        Trazodone may alter concentrations of Pgp substrates including fosamprenavir, indinavir, lopinavir, nelfinavir, and ritonavir.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        200 to 600 mg each bedtime for depression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vilazodone",
"       </td>",
"       <td>",
"        10 mg once daily 7 days; then 20 mg once daily",
"       </td>",
"       <td>",
"        <p>",
"         20 to 40 mg once daily",
"        </p>",
"        Maximum 20 mg per day with strong or moderate CYP 3A4 inhibitors",
"       </td>",
"       <td>",
"        <p>",
"         Low risk of sexual dysfunction. May improve quality of sleep.",
"        </p>",
"        More frequent diarrhea, nausea and insomnia.",
"       </td>",
"       <td>",
"        Vilazodone is metabolized by CYP3A4 (major), 2C19 (minor) and 2D6 (minor)",
"       </td>",
"       <td>",
"        <p>",
"         Strong and moderate inhibitors of CYP 3A4 including atazanavir, cobicistat containing coformulations, darunavir, efavirenz, fosamprenavir, indinavir, lopinavir, nelfinavir, ritonavir, and saquinavir may INCREASE vilazodone concentrations. Maximum dose 20 mg per day with strong or moderate CYP 3A4 inhibitors.",
"        </p>",
"        Strong inducers of CYP 3A4 including efavirenz, etravirine and nevirapine may DECREASE vilazodone concentrations. Effects may be variable.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nefazodone",
"       </td>",
"       <td>",
"        50 mg twice per day",
"       </td>",
"       <td>",
"        300 to 400 mg per day in divided doses",
"       </td>",
"       <td>",
"        <p>",
"         Somewhat sedating. Low risk of sexual dysfunction.",
"        </p>",
"        Rare reports of fatal hepatotoxicity led to market withdrawal in many countries.",
"       </td>",
"       <td>",
"        <p>",
"         Nefazodone is metabolized by CYP2D6 and 3A4",
"        </p>",
"        <p>",
"         Nefazodone is a potent inhibitor of CYP3A4",
"        </p>",
"        Nefazodone is an inducer of Pgp",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          NOTE:",
"         </strong>",
"         AVOID nefazodone in patients treated with HIV antiretrovirals, whenever possible.",
"        </p>",
"        <p>",
"         Not a first- or second-line choice. Numerous dose dependent drug interactions can increase risk of toxicities due to both nefazodone and HIV antiretrovirals.",
"        </p>",
"        <p>",
"         Nefazodone may alter concentrations of CYP 3A4 and/or Pgp substrates including atazanavir, darunavir, fosamprenavir, indinavir, lopinavir, maraviroc, nelfinavir, nevirapine, ritonavir, and saquinavir.",
"        </p>",
"        All HIV protease inhibitors",
"        <sup>",
"         &Delta;",
"        </sup>",
"        and cobicistat containing coformulations, may INCREASE concentrations of nefazodone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Dopamine-norepinephrine reuptake inhibitors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bupropion SR (sustained release)",
"       </td>",
"       <td>",
"        100 mg each morning",
"       </td>",
"       <td>",
"        150 to 400 mg per day in divided doses (depending on preparation)",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Stimulant effect may be useful for treatment of depressed patients with low energy and apathy.",
"        </p>",
"        Low risk of cognitive toxicity. Low risk of sexual dysfunction.",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Bupropion is metabolized by CYP2B6 and/or UDP-UGT glucuronidation",
"        </p>",
"        Bupropion is an inhibitor of CYP2D6",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Nelfinavir is an inhibitor of CYP2B6 and may INCREASE bupropion concentrations.",
"        </p>",
"        <p>",
"         Strong inducers of CYP2B6 and/or UDP-UGT including efavirenz, lopinavir, lopinavir-ritonavir, tipranavir-ritonavir, and nevirapine may DECREASE concentrations of bupropion.",
"        </p>",
"        <p>",
"         A 46 to 57 percent reduction in bupropion concentrations was reported in small studies of healthy volunteers when bupropion was co-administered with tipranavir-ritonavir, or efavirenz.",
"        </p>",
"        Titrate bupropion dose based upon response.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bupropion XL (extended release)",
"       </td>",
"       <td>",
"        150 mg each morning",
"       </td>",
"       <td>",
"        300 to 450 mg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Tricyclic antidepressants (TCAs)",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Desipramine",
"       </td>",
"       <td>",
"        10 to 25 mg daily",
"       </td>",
"       <td>",
"        50 to 300 mg daily",
"       </td>",
"       <td>",
"        Mildly activating; promotes weight gain. Stimulant effects may be useful for depressed patients with low energy and hypersomnia who have not responded to first line antidepressants. Useful for patients with comorbid painful conditions such as diabetic neuropathy. Established therapeutic serum concentration 125 to 300 ng/mL.",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Desipramine is metabolized by CYP2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2D6, all HIV protease inhibitors",
"         <sup>",
"          &Delta;",
"         </sup>",
"         may INCREASE desipramine concentrations.",
"        </p>",
"        <p>",
"         Use lowest tricyclic antidepressant dose and titrate based on response and/or antidepressant concentrations.",
"        </p>",
"        Elevated risk of serious cardiac arrhythmias in combination with other agents that can cause QTc prolongation or increase desipramine concentrations.",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nortriptyline",
"       </td>",
"       <td>",
"        10 to 25 mg at bed time",
"       </td>",
"       <td>",
"        50 to 150 mg at bedtime",
"       </td>",
"       <td>",
"        Mildly sedating; promotes weight gain. Taken at bed time for depressed patients with insomnia. May be useful for melancholic, anxious, depressed patients who have not responded to first line antidepressants. Useful for patients with comorbid painful conditions such as diabetic neuropathy. Established therapeutic serum concentration 50 to 150 ng/mL.",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Nortriptyline is metabolized by CYP2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2D6 including all HIV protease inhibitors",
"         <sup>",
"          &Delta;",
"         </sup>",
"         and cobicistat containing coformulations, may INCREASE nortriptyline concentrations.",
"        </p>",
"        <p>",
"         Use lowest tricyclic antidepressant dose and titrate based on response and/or antidepressant concentrations.",
"        </p>",
"        Elevated risk of serious cardiac arrhythmias in combination with other agents that can cause QTc prolongation or increase nortriptyline concentrations.",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Amitriptyline",
"       </td>",
"       <td>",
"        10 to 25 mg daily",
"       </td>",
"       <td>",
"        150 to 300 mg daily",
"       </td>",
"       <td>",
"        Sedating; promotes weight gain.",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Amitriptyline is metabolized by CYP2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2D6 including all HIV protease inhibitors",
"         <sup>",
"          &Delta;",
"         </sup>",
"         and cobicistat containing coformulations, may INCREASE amitriptyline concentrations.",
"        </p>",
"        <p>",
"         Use lowest tricyclic antidepressant dose and titrate based on response.",
"        </p>",
"        Elevated risk of serious cardiac arrhythmias in combination with other agents that can cause QTc prolongation or increase amitriptyline concentrations.",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clomipramine",
"       </td>",
"       <td>",
"        25 mg at bedtime",
"       </td>",
"       <td>",
"        100 to 300 mg at bedtime",
"       </td>",
"       <td>",
"        Sedating; promotes weight gain.",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Clomipramine is metabolized by CYP1A2, 2C19 and 2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP1A2, 2C19 and/or 2D6, including all HIV protease inhibitors",
"         <sup>",
"          &Delta;",
"         </sup>",
"         and cobicistat containing coformulations, may INCREASE clomipramine concentrations.",
"        </p>",
"        <p>",
"         Use lowest tricyclic antidepressant dose and titrate based on response.",
"        </p>",
"        Elevated risk of serious cardiac arrhythmias in combination with other agents that can cause QTc prolongation or increase clomipramine concentrations.",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Imipramine",
"       </td>",
"       <td>",
"        10 to 25 mg at bedtime",
"       </td>",
"       <td>",
"        150 to 300 mg at bedtime",
"       </td>",
"       <td>",
"        Sedating; promotes weight gain.",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Imipramine is metabolized by CYP2C19 and 2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2C19 and/or 2D6 including all HIV protease inhibitors",
"         <sup>",
"          &Delta;",
"         </sup>",
"         and cobicistat containing coformulations, may INCREASE imipramine levels.",
"        </p>",
"        <p>",
"         Use lowest tricyclic antidepressant dose and titrate based on response.",
"        </p>",
"        Elevated risk of serious cardiac arrhythmias in combination with other agents that can cause QTc prolongation or increase imipramine concentrations.",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Doxepin",
"       </td>",
"       <td>",
"        10 to 25 mg at bedtime",
"       </td>",
"       <td>",
"        150 to 300 mg at bed time",
"       </td>",
"       <td>",
"        Sedating; promotes weight gain.",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Doxepin is metabolized by CYP2D6",
"       </td>",
"       <td>",
"        <p>",
"         Strong inhibitors of CYP2D6 including all HIV protease inhibitors",
"         <sup>",
"          &Delta;",
"         </sup>",
"         and cobicistat containing coformulations, may INCREASE doxepin concentrations.",
"        </p>",
"        <p>",
"         Use lowest tricyclic antidepressant dose and titrate based on response.",
"        </p>",
"        Elevated risk of serious cardiac arrhythmias in combination with other agents that can cause QTc prolongation or increase doxepin concentrations.",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Herbal products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        St John's wort (Hypericum perforatum)",
"       </td>",
"       <td colspan=\"3\">",
"        <strong>",
"         Do NOT co-administer St John's wort with HIV antiretroviral drugs.",
"        </strong>",
"       </td>",
"       <td>",
"        St John's wort is an inducer of CYP1A2, 2C9, and 3A4",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Concomitant use of St John's wort and HIV antiretroviral drugs is contraindicated.",
"         </strong>",
"        </p>",
"        Use of St John's wort with all HIV protease inhibitors",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , efavirenz, etravirine, nevirapine, and maraviroc can DECREASE antiretroviral concentrations and cause virologic resistance and treatment failure.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     IMPORTANT NOTE: Not all potential interactions are listed.",
"    </strong>",
"    Additional interactions of antidepressants with other medications taken by HIV patients and management suggestions may be determined using the drug interactions tool (Lexi-Interact Online) included in UpToDate. Agents are listed within each class in order of preference based upon tolerability in most patients.",
"    <br/>",
"    <strong>",
"     Use doses at the lower end of ranges shown for starting and maintenance treatment of depression in patients with HIV who are medically ill, older or debilitated.",
"    </strong>",
"    <div class=\"footnotes\">",
"     AUC: area under the time versus concentration curve; CYP: cytochrome P450; Pgp: P-glycoprotein efflux transporter; UDP-UGT: uridine 5'-diphospho-glucuronosyltransferase catalyst of glucuronidation.",
"     <br/>",
"     * Maximum recommended dose of citalopram is 20 mg for patients &gt;60 years of age, with significant hepatic insufficiency, or taking medications that can increase citalopram levels. For additional information, refer to UpToDate topic on selective serotonin reuptake inhibitors (SSRIs) section on cardiac side effects.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     QTc prolonging antidepressant drugs can have additive effects with other drugs that prolong the QTc interval, including saquinavir, and may cause life-threatening ventricular arrhythmias. Refer to topics on selective serotonin reuptake inhibitors (SSRIs) and tricyclic antidepressants for treating depressed adults.",
"     <br/>",
"     &Delta; HIV protease inhibitors include: atazanavir, darunavir, fosamprenavir, indinavir, lopinavir, nelfinavir, ritonavir, saquinavir and tipranavir.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Due to significant anticholinergic side effects, tricyclic antidepressants (TCAs) may NOT be well tolerated in patients with HIV who are also medically ill. TCAs may be fatal in overdose and can cause cardiac arrhythmias or orthostatic hypotension. Serum drug concentration monitoring may be useful for guiding treatment with amitriptyline, desipramine, imipramine, and nortriptyline. For additional information refer to UpToDate topic on unipolar depression and tricyclic and tetracyclic drugs for treating depressed adults.",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Lacy CF, et al (eds) Lexicomp Online. Copyright &copy; 1978-2013 Lexicomp, Inc. All Rights Reserved.",
"      </li>",
"      <li>",
"       Wynn GH, et al (eds) Clinical Manual of Drug Interaction Principles for Medical Practice APA publishing, Washington DC. Copyright &copy; 2009.",
"      </li>",
"      <li>",
"       Panel on Antiretroviral Guidelines for Adults and Adolescents. Guidelines for the use of antiretroviral agents in HIV-1-infected adults and adolescents. Department of Health and Human Services. 1&ndash;239. Available at",
"       <a href=\"file://www.aidsinfo.nih.gov/ContentFiles/AdultandAdolescentGL.pdf\" target=\"_blank\">",
"        file://www.aidsinfo.nih.gov/ContentFiles/AdultandAdolescentGL.pdf",
"       </a>",
"       . Drug interactions section accessed April 18, 2012.",
"      </li>",
"      <li>",
"       Hill L and Lee KC Pharmacotherapy considerations in patients with HIV and psychiatric disorders: Focus on antidepressants and antipsychotics. Ann Pharmacother 2013;47:75.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
