var title_f16_35_16955="Outpatient care for VTE";
var content_f16_35_16955=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F70140&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F70140&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Minimal requirements for early hospital discharge or outpatient therapy of venous thromboembolic disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        The responsible physician must ensure that all of the following conditions apply:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The patient is ambulatory and in stable condition, with normal vital signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        There is a low a priori risk of bleeding in the patient",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Severe renal insufficiency is not present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        There is a practical system in place for the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Administration of LMW heparin and/or warfarin with appropriate monitoring,",
"        <strong>",
"         and",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Surveillance and treatment of recurrent VTE and bleeding complications",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     VTE: venous thromboembolism; LMW heparin: low molecular weight heparin.",
"    </div>",
"    <div class=\"reference\">",
"     <br>",
"      Adapted from Hyers, TM, Agnelli, G, Hull, RD, et al. Antithrombotic therapy for venous thromboembolic disease. Chest 2001; 119:176S. (Sixth ACCP Consensus Conference on Antithrombotic Therapy).",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
