var content_f16_35_16958=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F77082&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F77082&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 510px\">",
"   <div class=\"ttl\">",
"    LDL-cholesterol and coronary risk after pravastatin",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 490px; height: 305px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the CARE trial of 4159 patients, therapy with pravastatin reduced the relative risk of the primary endpoint (coronary death or nonfatal myocardial infarction) at all serum LDL-cholesterol concentrations &ge;125 mg/dL (3.2 mmol/L). Lower LDL- cholesterol values were not associated with further benefit. The blue line represents the percentages of patients at each LDL concentration who were in the pravastatin group.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Sacks, FM, Moye, LA, Davis, BR, et al, Circulation 1998; 97:1446",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
