" <div class=\"graphic2\" style=\"width: 1070px;\">",
"  <div class=\"videoplayer\" h264=\"./images/PC/58435/Back_leg_raise_video.mp4?title=Back+leg+raise+video\" style=\"width:480px;height:336px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Strength exercise video: Back leg raise",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 369px; height: 297px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This exercise strengthens your buttocks and lower back. For an added challenge, you can modify the exercise to improve your balance.",
"    <br>",
"     <ol>",
"      <li>",
"       Stand behind a sturdy chair, holding on for balance. Breathe in slowly.",
"      </li>",
"      <li>",
"       Breathe out and slowly lift one leg straight back without bending your knee or pointing your toes. Try not to lean forward. The leg you are standing on should be slightly bent.",
"      </li>",
"      <li>",
"       Hold position for one second.",
"      </li>",
"      <li>",
"       Breathe in as you slowly lower your leg.",
"      </li>",
"      <li>",
"       Repeat 10 to 15 times.",
"      </li>",
"      <li>",
"       Repeat 10 to 15 times with other leg.",
"      </li>",
"      <li>",
"       Repeat 10 to 15 more times with each leg.",
"      </li>",
"     </ol>",
"     As you progress, you may want to add ankle weights.",
